import React from 'react';
import './App.css'
const blog = (state)=>{
const {items}=state;
const blogin = items.map(item=>{
    items.push(item);
    return <div key={item.id}>
{        item.name
}
    </div>
})

return(
<div >
        <input type="text"/>
    <button onClick={blogin}>Add Course</button>
</div>

)


}
export default blog;
